input_query:
PREFIX : <http://ekaw#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
SELECT ?reviewer WHERE {
?paper :hasReviewer ?reviewer.
?paper rdf:type :Accepted_Paper.
}

output_query:
PREFIX : <http://ekaw#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT ?rank WHERE {
?paper :hasReviewer ?reviewer.
 ?paper rdf:type :Accepted_Paper.
 }

input_query:
PREFIX : <http://ekaw#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
SELECT ?author WHERE {
?author :authorOf ?paper.
?paper rdf:type :Regular_Paper.
}

output_query:
PREFIX : <http://ekaw#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT ?rank WHERE {
?author <http://confOf#writes> ?paper.
 ?paper rdf:type :Regular_Paper.
 }

expected_query:
PREFIX : <http://ekaw#> 
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> 

SELECT ?author WHERE {
?paper <http://cmt#hasAuthor> ?author. 

?paper rdf:type <http://cmt#PaperFullVersion>. 
}

output_query:
PREFIX : <http://cmt#>

SELECT ?rank WHERE {
?person rdf:type :Chairman.
 ?papier :hasAuthor ?person.
 ?papier rdf:type :Paper.
 }

